import { useState } from "react";

function OCRSlot() {
  return (
    <div
      ref={boxRef}
      className="paste-box"
      contentEditable
      suppressContentEditableWarning
    >
      {imageURL ? (
        <img src={imageURL} alt="Pasted" className="preview-img" />
      ) : (
        <p>클릭 후 Ctrl+V로 이미지를 붙여넣기</p>
      )}
    </div>
  );
}

export default OCRSlot;
